query:
{
  getOrgPlans {
    _id
    from
    to
    revokedAt
    plan {
      name
      totalUsage {
        storage {
          bound
        }
      }
      rateLimitation {
        apiCalls {
          bound
          period
        }
      }
      featuresAccessibility {
        authorization
        apiKeys {
          bound
        }
      }
    }
    usage {
      totalUsage {
        storage
      }
      rateLimitation {
        apiCalls {
          usage
          startedAt
        }
      }
    }
    subscription {
      externalId
      interval
    }
  }
}
